import React from "react";
import {
  Card,
  //   CardImg,
  CardText,
  CardBody,
  CardLink,
  CardTitle,
  CardSubtitle
} from "reactstrap";
import "./ItemsInfo.css";
import Gobackbtn from "../Gobackbtn";

const ItemsInfo = props => {
  return (
    <div className="row col-lg-3">
      <Gobackbtn />
      <Card className="card">
        <img
          width="100%"
          src="https://via.placeholder.com/130x150"
          alt="Card image cap"
        />
      </Card>
    </div>
  );
};

export default ItemsInfo;
